import {css} from "@emotion/core";
import DotLoader from "react-spinners/DotLoader";

const override = css`
	display: block;
	margin: 0 auto;
	border-color: red;
`;

export default function Spinner() {
	<DotLoader
		css={override}
		size={50}
		//size={"150px"} this also works
		color={"#123abc"}
	/>;
}
